import React from 'react'
import NavBar from './NavBar'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Menu from './Menu';


const Home = () => {
  return (
    <div>
        <NavBar/>
        <Menu/>
        <Router>
            <Routes>
                <Route path="/" element={<Home/>} exact />
            </Routes>
        </Router>
    </div>
  )
}

export default Home
